import './header.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const header = () => {
  return (
    <div className="header">
        <div className="headerList">
            <div className="headerListItem">
            <FontAwesomeIcon icon="fa-solid fa-bed-front" />
            </div>
        </div>
    </div>
  )
}

export default header
